import classes from '../UI/Card.module.css';

const QuesItem = (props) => {
    const questionNumber = +(props.index+1);
    return(<SectionMedium>
        <div className={classes.container}>
            <b></b>{questionNumber}- {props.ques.question}
        </div>
    </SectionMedium>);
}
